import React from "react";
import "./Menu.css";

function Menu() {
  return (
    <div className="menu">
      <ul>
        <li>Settings</li>
        <li>Account</li>
        <li>About</li>
        <li>Contacts</li>
      </ul>
    </div>
  );
}

export default Menu;
